import "./Expenses.css";
import ExpenseItem from "./ExpenseItem";
import Card from "./Card";

function Expenses(expenses) {
    return (
        <Card className="expenses">
            <ExpenseItem
                date={expenses.expense[0].date}
                title={expenses.expense[0].title}
                amount={expenses.expense[0].amount}
            />
            <ExpenseItem
                date={expenses.expense[1].date}
                title={expenses.expense[1].title}
                amount={expenses.expense[1].amount}
            />
            <ExpenseItem
                date={expenses.expense[2].date}
                title={expenses.expense[2].title}
                amount={expenses.expense[2].amount}
            />
            <ExpenseItem
                date={expenses.expense[3].date}
                title={expenses.expense[3].title}
                amount={expenses.expense[3].amount}
            />
        </Card>
    );
}

export default Expenses;
